import React from 'react';

function hello() {
  return (
    <div className="hello">
      <h1>Name:{this.props.name}</h1>
      <h2>Education:{this.props.edu}</h2>
      <h3>Email:{this.props.email}</h3>
    </div>
  );
}

export default hello;
